import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

class FormContact extends Component {

  constructor( props )
  {
    super();
  }

  render() {

    let { name, phone, email, subject, message, button } = this.props.form;

    return (
          <div className="container-page">

            <form data-form-contact>

              <div data-row>

                <div className="cl3">
                  <label>{name.label}</label>
                  <input type="text" placeholder={name.placeholder} />
                </div>

                <div className="cl3">
                  <label>{email.label}</label>
                  <input type="text" placeholder={email.placeholder} />
                </div>

                <div className="cl3">
                  <label>{phone.label}</label>
                  <input type="text" placeholder={phone.placeholder} />
                </div>

              </div>

              <div data-row>

                <div className="cl1">
                  <label>{subject.label}</label>
                  <input type="text" placeholder={subject.placeholder} />
                </div>

              </div>

              <div data-row>

                <div>
                  <label>Sua Mensagem</label>
                  <textarea data-message placeholder="Digite sua mensagem aqui"></textarea>
                </div>

              </div>

              <div data-row>
                <button data-colored="big" data-send-message>Enviar Minha Mensagem</button>
              </div>

            </form>

          </div>
    );
  }
}
export default FormContact;
